import UseRoutes from './UseRoutes';
import {BrowserRouter as Router} from 'react-router-dom'
import MainAppBar from './components/MainAppBar';

function App() {
  const routes = UseRoutes()
  return (
    <Router>
    <div className="">
      <MainAppBar />
      {routes}
    </div>
    </Router>
  );
}

export default App;
